// SPDX-License-Identifier: MIT
// split native tokens to wallets based on shares
// Use 0.8.18 to deploy
// Add payees in this format: ["0x5B38Da6a701c568545dCfcB03FcB875f56beddC4", "0xAb8483F64d9C6d1EcF9b849Ae677dD3315835cb2"] 

// Add Shares in this format: ["1", "2"] wallet 1 33.33% and wallet 2 66.66%. e.g2 ["1", "1", "2"] wal1= 25% wal2= 25% wal3= 50% etc...
// IMPORTANT!! Ensure same number of wallets and same number share! If values are not same length then contract will error. e.g 2 wallets then nedd 2 share values
// On clicking distribute button, payments are sent to payees based on the shares added.
// Add rewards to the contract's address

// contract allows you to provide shares for each payee, and the distribution will be based on those shares, 
// without requiring the total to add up to 100%. Each payee will receive a share of the total funds according to the specified values.




pragma solidity ^0.8.0;

interface IERC20 {
    function transfer(address to, uint256 value) external returns (bool);
    function balanceOf(address account) external view returns (uint256);
}

contract NativePaymentSplitter {
    address[] public payees;
    uint256[] public payeePercentages;
    address public owner;
    address public tokenAddress;

    constructor(address[] memory _payees, uint256[] memory _payeePercentages, address _tokenAddress) {
        require(_payees.length > 0, "No payees provided");
        require(_payees.length == _payeePercentages.length, "Invalid payee percentages");
        require(_tokenAddress != address(0), "Invalid token address");

        owner = msg.sender;
        payees = _payees;
        payeePercentages = _payeePercentages;
        tokenAddress = _tokenAddress;
    }

    modifier onlyOwner() {
        require(msg.sender == owner, "Not the contract owner");
        _;
    }

    receive() external payable {
        distribute();
    }

    function distribute() public {
        require(tokenAddress != address(0), "Token address not set");

        uint256 balance = IERC20(tokenAddress).balanceOf(address(this));
        require(balance > 0, "No tokens to distribute");

        uint256 totalPercentage;
        for (uint256 i = 0; i < payeePercentages.length; i++) {
            require(payeePercentages[i] > 0, "Invalid payee percentage");
            totalPercentage += payeePercentages[i];
        }
        require(totalPercentage == 100, "Total percentage must equal 100");

        for (uint256 i = 0; i < payees.length; i++) {
            uint256 amount = (balance * payeePercentages[i]) / 100;
            IERC20(tokenAddress).transfer(payees[i], amount);
        }
    }

    function updatePayees(address[] memory _payees, uint256[] memory _payeePercentages) public onlyOwner {
        require(_payees.length > 0, "No payees provided");
        require(_payees.length == _payeePercentages.length, "Invalid payee percentages");

        payees = _payees;
        payeePercentages = _payeePercentages;
    }


    function withdrawTokens() public onlyOwner {
        require(tokenAddress != address(0), "Token address not set");

        IERC20 token = IERC20(tokenAddress);
        uint256 balance = token.balanceOf(address(this));

        require(balance > 0, "No tokens to withdraw");

        token.transfer(owner, balance);
    }

    function changeTokenAddress(address newTokenAddress) public onlyOwner {
        require(newTokenAddress != address(0), "Invalid token address");
        tokenAddress = newTokenAddress;
    }

    function transferOwnership(address newOwner) public onlyOwner {
        require(newOwner != address(0), "Invalid new owner address");
        owner = newOwner;
    }

    function recoverLostFunds(address tokenToRecover, uint256 amount) public onlyOwner {
        require(tokenToRecover != address(0), "Invalid token address");
        require(amount > 0, "Invalid amount");

        if (tokenToRecover == address(0)) {
            payable(owner).transfer(amount);
        } else {
            IERC20(tokenToRecover).transfer(owner, amount);
        }
    }

    function getTokenBalance() public view returns (uint256) {
        require(tokenAddress != address(0), "Token address not set");
        return IERC20(tokenAddress).balanceOf(address(this));
    }
}


/*
# PaymentSplitter Readme

The PaymentSplitter is a smart contract designed to facilitate the distribution of funds among multiple payees based on specified share percentages. It supports ERC-20 tokens and provides flexibility in setting individual payee shares. This README provides instructions on how to use the contract, update payees and their share percentages, and an explanation of the share feature.

## How to Use PaymentSplitter

### 1. Deployment:

Deploy the CheynesPaymentSplitter contract by providing the following parameters:
- `_payees`: An array of Ethereum addresses representing payees.
- `_payeeShares`: An array of corresponding share percentages for each payee.
- `_tokenAddress`: The address of the ERC-20 token to be used for payments.

```solidity
constructor(address[] memory _payees, uint256[] memory _payeeShares, address _tokenAddress)
```

### 2. Distribution:

To distribute funds, transfer ERC-20 tokens to the contract's address. Alternatively, you can send Ether to trigger the distribution using the fallback function.

```solidity
receive() external payable
```

```solidity
function distribute() public
```

### 3. Updating Payees and Share Percentages:

The contract owner can update payees and their corresponding share percentages.

```solidity
function updatePayees(address[] memory _payees, uint256[] memory _payeeShares) public onlyOwner
```

### Share Feature:

The share percentages are used directly as shares for each payee. For example, if you provide [1, 2, 1] as share percentages for three wallets, the total shares would be 4. The distribution would be as follows:
- Wallet 1 and Wallet 3: 25% each (1/4 * 100)
- Wallet 2: 50% (2/4 * 100)

This approach allows for a dynamic split based on the provided share percentages, rather than requiring the total to add up to 100%.

### Additional Functions:

- **Withdraw Tokens:**
  The owner can withdraw remaining ERC-20 tokens from the contract.
  ```solidity
  function withdrawTokens() public onlyOwner
  ```

- **Change Token Address:**
  The owner can change the ERC-20 token address.
  ```solidity
  function changeTokenAddress(address newTokenAddress) public onlyOwner
  ```

- **Transfer Ownership:**
  The owner can transfer ownership to another Ethereum address.
  ```solidity
  function transferOwnership(address newOwner) public onlyOwner
  ```

- **Recover Lost Funds:**
  In case of accidental transfers, the owner can recover lost funds.
  ```solidity
  function recoverLostFunds(address tokenToRecover, uint256 amount) public onlyOwner
  ```

- **Get Token Balance:**
  Retrieve the current ERC-20 token balance held by the contract.
  ```solidity
  function getTokenBalance() public view returns (uint256)
  ```

### Important Notes:
- Ensure that the token address is correctly set before attempting any distribution.
- The contract owner has exclusive rights to update settings and manage funds.
- Verify contract functionality on a test network before deploying to the mainnet. Ensure the security and correctness of the contract code before interacting with it on the Ethereum blockchain.
*/

